public String toString() {
  StringBuilder sb = new StringBuilder()
      .append("loc=").append(getLocation());
  if (hasResult()) {
    sb.append(" result=").append(getResult());
  }
  if (hasException()) {
    sb.append(" exception=").append(getException());
  }
  return sb.toString();
}
